import "../assets/css/galeria.css";
import useImages from "../hooks/useImages";
import Heart from "./Heart";

export default function Home() {


  const { imagenes, setFavorito } = useImages();

  console.log("FAVORITOS desde galeria", imagenes);



  return (
    <>
      <div className="galeria grid-columns-5 p-3">
        {imagenes.map((imagen) => (
          
          <img onClick={(e)=>  setFavorito(e.target.currentSrc)} key={imagen.id} src={imagen.src.tiny}></img>
        ))}


      </div>
    </>
  );
}
